PurchaseItemFullResponse::ServiceActionEnum PurchaseItemFullResponse::toServiceActionEnum(const utility::string_t& value) const
{
    
    if (value == utility::conversions::to_string_t("DAY_PREMIUM")) {
        return ServiceActionEnum::DAY_PREMIUM;
    }
    
    if (value == utility::conversions::to_string_t("WEEK_PREMIUM")) {
        return ServiceActionEnum::WEEK_PREMIUM;
    }
    
    if (value == utility::conversions::to_string_t("MONTH_PREMIUM")) {
        return ServiceActionEnum::MONTH_PREMIUM;
    }
    
    if (value == utility::conversions::to_string_t("YEAR_PREMIUM")) {
        return ServiceActionEnum::YEAR_PREMIUM;
    }
    
    if (value == utility::conversions::to_string_t("LIFETIME_PREMIUM")) {
        return ServiceActionEnum::LIFETIME_PREMIUM;
    }
    
    if (value == utility::conversions::to_string_t("ADD_TICKET")) {
        return ServiceActionEnum::ADD_TICKET;
    }
    
    if (value == utility::conversions::to_string_t("ADD_GIFT")) {
        return ServiceActionEnum::ADD_GIFT;
    }
    
    if (value == utility::conversions::to_string_t("ADD_POINTS")) {
        return ServiceActionEnum::ADD_POINTS;
    }
    
    throw std::invalid_argument("Invalid value for conversion to ServiceActionEnum");
}


